import { useProfileStyles } from './styles';
import Typical from 'react-typical';
import { Data } from './Data';
import Images from '../../assets/images/prof-pic.jpg';
import Button from '../Button/Button';
import { social } from './Data';
import theme from '../../theme';
import { useContext } from 'react';
import { blue } from '@mui/material/colors';
import TextRotation from '../TextRotation/TextRotation';

const Profile = () => {
	const classes = useProfileStyles();
	const scrollText = 'Scroll down - Scroll down -';
	return (
		<div className={classes.root}>
			<div className={classes.Container}>
				<div className={classes.hero}>
					<div className={classes.headerText}>
						{' '}
						Creative Front - End <span>Developer.</span>{' '}
					</div>
					<div className={classes.imgContainer}>
						<img
							src={Images}
							className={classes.img}
						/>
						<div className={classes.info}>
							<div className={classes.social}></div>
							<span></span>
						</div>
					</div>
					</div>
				<div
					style={{
						fontSize: '20px',
					}}>
					<Typical
						loop={Infinity}
						steps={[
							'Hello guys,',
							2000,
							"I'm Ayo, a creative frontend developer.",
							2000,
							'I build software applications for organisations of various sizes.',

							3000,
							'',
						]}
					/>
				</div>

				<div className={classes.buttonGroup}>
					<button className={classes.leftBtn}>Let's talk</button>
					<button className={classes.rightBtn}>view resume</button>
				</div>

				<TextRotation />
			</div>
		</div>
	);
};

export default Profile;
